styles:
li{list-style:none}
.nav-item .nav-link:hover {
    color: rgba(255, 255, 255, 0.75);
    background-color: #596773;
}
  .nav-item .nav-link:hover img{
    opacity: 1;
}
  .nav-item .nav-link{
    border-left: 2px solid transparent;
    font-size: 13px;
    letter-spacing: 0.05em;
    padding: .7rem 0.7rem;
}
  .nav-item.active> .nav-link{
    border-left: 2px solid #35c4ff;
    background-color: #465766;
}
  .nav-item .nav-link img{
    height: 21px;
    width: 21px;
    margin-right: 15px;
    margin-top: -3px;
    opacity: 0.7;
}
 > .nav-item.active> .nav-link img{
    opacity: 1;
}
 > .nav-item ul.nav-second-level > .nav-item {
    padding-left: 0px;
}
 > .nav-item ul.nav-second-level > .nav-item > .nav-link {
    padding-left: 20px;
}
 > .nav-item ul.nav-second-level {
    padding-left: 0;
}
.sidebar-menu-item{display:none}
.nav-item  {
    width: 300px;
}

.sub-menu-landing {
    background-color: #fff;
    padding: 15px 30px;
    border-radius: 2px;
}

.sub-menu-landing .sml-img-data-wrap {
    padding: 10px;
    cursor: pointer;
    min-height: 80px;
    float: left;
}

.sub-menu-landing .sml-img-data-wrap:hover {
    background-color: #F8F9FB;
    border-radius: 4px;
}

.sub-menu-landing .sml-img-wrap {
    width: 50px;
    height: 50px;
    float: left;
    margin-right: 10px;
    padding: 5px;
}
.sub-menu-landing .sml-img-wrap img.svg{
    width: 100%;
    height: auto;
}
.sub-menu-landing .sml-Data {
    margin-top: 5px;
}
.sub-menu-landing .sml-Data h5 {
    margin: 0;
    color: #555557;
    font-size: 15px;
}

.sub-menu-landing .sml-Data p {
    color: #9e9e9e;
    margin: 0;
    font-size: 13px;
}
